export interface response {
    created_at: string;
    deleted_at: string;
    first_post_id: number;
    forum_id: number;
    id: number;
    is_locked: boolean;
    last_post_id: number;
    post_count: number;
    title: string;
    type: string;
    updated_at: string;
    user_id: number;
    poll: string;
}
export interface types {
    /**
     * Return topic data and posts list
     *
     * ## Example
     *
     * ```js
     * const { v2, auth } = require('osu-api-extended');
     *
     * const main = async () => {
     *   await auth.login(CLIENT_ID, CLIENT_SECRET);
     *
     *   const v2_forums_topic_edit_title = await v2.forums.topic.edit.title(topic_id, title);
     *   console.log(v2_forums_topic_edit_title);
     * };
     *
     * main();
     * ```
     * @param {number} topic_id Topic id
     * @param {string} title New title
    */
    (topic_id: number, title: string): Promise<response[]>;
}
